    "contracts/MatToken.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity =0.7.6;
pragma abicoder v2;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "./UniswapV2/IUniswapV2Pair.sol";
import "./StakingRewards/IStakingReward.sol";
import "hardhat/console.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract MatToken is ERC20, Ownable {
  using SafeMath for uint256;

  address private _uniswapV2RouterAddress;
  address private _maintainer;
  address private _destroyAddress;
  uint256 private _destroyFeeRate;
  address private _usdtAddress;
  uint256 private _sellFeeRate;
  uint256 private _buyFeeRate;
  uint256 private _gain;
  uint256 private _totalLiquidity;
  address private _stakingContract;

  mapping(address => bool) private _blacklist;

  event Log(string message, uint256 value);

  constructor(
    uint256 initialSupply,
    address usdtAddress,
    address destroyAddress,
    uint256 sellFee,
    uint256 buyfee,
    uint256 destroyFee
  ) ERC20("Meta Angel Token", "MAT") Ownable() {
    _mint(msg.sender, initialSupply);
    _usdtAddress = usdtAddress;
    _destroyAddress = destroyAddress;
    _sellFeeRate = sellFee;
    _buyFeeRate = buyfee;
    _destroyFeeRate = destroyFee;
    _gain = 10 ** 8;
  }

  /**
   *@dev set  maintainer
   */
  function setMaintainer(address maintainer) public onlyOwner {
    _maintainer = maintainer;
  }

  /**
   *@dev  delete maintainer
   */
  function deleteMaintainer() public onlyOwner {
    _maintainer = address(0);
  }

  /**
   *@dev get maintainer
   *@return maintainer
   */
  function getMaintainer() public view onlyOwner returns (address) {
    return _maintainer;
  }

  function setUniswapV2RouterAddress(
    address uniswapV2RouterAddress
  ) public onlyOwner {
    _uniswapV2RouterAddress = uniswapV2RouterAddress;
  }

  function getUniswapV2RouterAddress() public view returns (address) {
    require(
      (msg.sender == owner() || msg.sender == _maintainer),
      "Permission denied"
    );
    return _uniswapV2RouterAddress;
  }

  function setDestroyAddress(address destroyAddress) public onlyOwner {
    _destroyAddress = destroyAddress;
  }

  function setStakingRewardsAddress(address stakingContract) public onlyOwner {
    _stakingContract = stakingContract;
  }

  function getStakingRewardsAddress() public view returns (address) {
    require(
      (msg.sender == owner() || msg.sender == _maintainer),
      "Permission denied"
    );
    return _stakingContract;
  }

  function transfer(
    address recipient,
    uint256 amount
  ) public virtual override returns (bool) {
    __transfer(_msgSender(), recipient, amount);
    return true;
  }

  function transferFrom(
    address spender,
    address recipient,
    uint256 amount
  ) public virtual override returns (bool) {
    __transfer(spender, recipient, amount);
    _approve(
      spender,
      _msgSender(),
      allowance(spender, _msgSender()).sub(
        amount,
        "ERC20: transfer amount exceeds allowance"
      )
    );
    return true;
  }

  function getLiquidity() public view returns (uint256) {
    require(
      (msg.sender == owner() || msg.sender == _maintainer),
      "Permission denied"
    );
    return _totalLiquidity;
  }

  function __transfer(
    address sender,
    address recipient,
    uint256 amount
  ) private returns (bool) {
    require(!_blacklist[_msgSender()], "ERC20: Sender is from blacklist");

    if (sender != _uniswapV2RouterAddress && recipient != _uniswapV2RouterAddress) {
      _transfer(sender, recipient, amount);
      return true;
    }

    IUniswapV2Router02 swapRouter = IUniswapV2Router02(_uniswapV2RouterAddress);
    uint destroyFee = amount.mul(_destroyFeeRate).div(_gain);
    uint realAmount = 0;
    // sell
    if (recipient == _uniswapV2RouterAddress) {
      uint256 fee = amount.mul(_sellFeeRate).div(_gain);
      realAmount = amount.sub(fee).sub(destroyFee);
      uint feeToSell = fee.div(2);
      address[] memory path = new address[](2);
      path[0] = address(this);
      path[1] = _usdtAddress;
      _transfer(sender, address(this), fee);

      uint allownace = IERC20(address(this)).allowance(
        address(this),
        _uniswapV2RouterAddress
      );

      if (allownace < feeToSell) {
        IERC20(address(this)).approve(
          _uniswapV2RouterAddress,
          feeToSell.mul(10000)
        );
      }

      swapRouter.swapExactTokensForTokens(
        feeToSell,
        0,
        path,
        address(this),
        block.timestamp + 7 days
      );

      uint256 matBalance = IERC20(address(this)).balanceOf(address(this));
      uint256 usdtBalance = IERC20(_usdtAddress).balanceOf(address(this));

      allownace = IERC20(address(this)).allowance(
        address(this),
        _uniswapV2RouterAddress
      );
      if (allownace < matBalance) {
        IERC20(address(this)).approve(
          _uniswapV2RouterAddress,
          matBalance.mul(10000)
        );
      }
      allownace = IERC20(_usdtAddress).allowance(
        address(this),
        _uniswapV2RouterAddress
      );
      if (allownace < usdtBalance) {
        IERC20(_usdtAddress).approve(
          _uniswapV2RouterAddress,
          usdtBalance.mul(10000)
        );
      }
      (, , uint liquidity) = swapRouter.addLiquidity(
        address(this),
        _usdtAddress,
        matBalance,
        usdtBalance,
        0,
        0,
        address(this),
        block.timestamp + 7 days
      );
      _totalLiquidity = liquidity;
    }
    // buy
    else if (sender == _uniswapV2RouterAddress) {
      uint256 fee = amount.mul(_buyFeeRate).div(_gain);
      amount = amount.sub(fee).sub(destroyFee);
      _transfer(sender, address(this), fee);
      IStakingReward _stakingReward = IStakingReward(_stakingContract);
      IERC20(address(this)).approve(_stakingContract, fee);
      _stakingReward.transferDividends(fee);
    }

    _transfer(sender, _destroyAddress, destroyFee);
    _transfer(sender, recipient, realAmount);
    return true;
  }

  /**
   * @dev Check if the {account} is in blacklist.
   *
   */
  function checkBlacklist(address account) public view returns (bool) {
    return _blacklist[account];
  }

  /**
   * @dev Add the {account} to the blacklist.
   * Can only be called by the current owner.
   */
  function addToBlacklist(address account) public onlyOwner returns (bool) {
    _blacklist[account] = true;
    return true;
  }

  /**
   * @dev Remove the {account} to the blacklist.
   * Can only be called by the current owner.
   */
  function removeFromBlacklist(
    address account
  ) public onlyOwner returns (bool) {
    _blacklist[account] = false;
    return true;
  }

  function transferOut(
    address tokenAddress,
    uint256 amount
  ) public onlyOwner returns (bool) {
    IERC20(tokenAddress).transfer(owner(), amount);
    return true;
  }
}
"
